export const styles = theme => ({
    root: {
        background: theme.palette.grey[1000],
        display: "block",
        margin: `0 0 ${theme.spacing(2)}px`,
        padding: `${theme.spacing(1)}px ${theme.spacing(2)}px`,
        width: "100%",
    },
});
